import React from 'react';
import {
  Switch,
  Route,
  BrowserRouter as Router,
} from "react-router-dom";
import "./i18n/i18n";
import Main from './modules/pc/main/Main';
import Service from './modules/pc/service/Service';

const App: React.FC = () => {
  return (
    <Router>
      <Switch>
        <Route path="/service">
          <Service />
        </Route>
        <Route path="/">
          <Main />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
